  GAME INFORMATION:
 -------------------

  From the creators of the award-winning Medal of Honor: Allied Assault comes
  Men of Valor, 2015's historical first-person shooter that portrays infantry
  combat during the Vietnam War.

  Combining the latest Unreal technology with the gameplay expertise of 2015,
  Men of Valor immerses you in the humid jungles of Southeast Asia in the
  most controversial conflict of the modern era. Experience the intensity of
  the historical battlefield recreated with cunning AI, detailed graphics,
  and interactive scripted sequences that put you in the middle of scenes
  like those in the finest war films. Battle your way through the major
  actions in the conflict, from search and destroy missions around Danang
  airbase to the Tet offensive and the counterattack on Hue. Or experience
  the entire thrilling tour of duty with friends via various multiplayer
  modes, which allow you to view the war from the perspective of the Viet
  Cong guerillas as well as U.S. forces. 


